import React from "react";

const Mainpage2 = () => {
  return (
    // <>
    //   <div className="row"></div>
    // <div className="container-fluid">
    //   <div className="row flex-wrap">
    //     <div className="bg-primary col-auto col-md-2 min-vh-100">
    //       <div className="my-5">
    //         <a
    //           href=""
    //           className="d-flex align-items-center text-decoration-none "
    //         >

    //             <span className="fs-4 d-none d-sm-inline text-light ">Menu</span>

    //         </a>
    //           <ul className="nav nav-pills flex-column mt-4">
    //               <li className="nav-item">
    //                 <a href="" className="nav-link active text-primary bg-light">EXAMS</a>
    //               </li>
    //               <li className="nav-item">
    //                 <a href="" className="nav-link active text-primary bg-light mt-2">TOPICS</a>
    //               </li>
    //               <li className="nav-item">
    //                 <a href="" className="nav-link active text-primary bg-light mt-2">QUESTIONS</a>
    //               </li>
    //           </ul>
    //       </div>
    //     </div>
    //   </div>
    // </div>

    <div className="container-fluid">
      <div className="row">
        <div className="flex flex-column justify-content-between col-auto bg-primary min-vh-100">
          <div>
            <a
              href=""
              className="text-white text-decoration-none d-flex align-items-center ms-4"
              role="button"
            >
              <span className="fs-5">Admin</span>
            </a>
            <ul className="nav nav-pills flex-column mt-2 mt-sm-0" id="menu">
              {/* <li className="nav-item">
                <a href="" className="nav-link active text-primary bg-light">
                  <i className="fa fa-gauge"></i>
                  <span className="ms-2">DashBoard</span>
                </a>
              </li> */}
              <li className="nav-item">
                <a href="" className="nav-link active text-primary bg-light">
                  <i className="fa fa-house"></i>
                  <span className="ms-2">DashBoard</span>
                </a>{" "}
              </li>
              <li className="nav-item">
                <a href="" className="nav-link active text-primary bg-light">
                  <i className="fa fa-gauge"></i>
                  <span className="ms-2">DashBoard</span>
                </a>{" "}
              </li>
              <li className="nav-item disabled">
                <a href="#sidemenu" data-bs-toggle="collapse" className="nav-link active text-primary bg-light">
                  <i className="fa fa-gauge"></i>
                  <span className="ms-2">EXAM</span>
                </a>{" "}
                <ul
                  class="nav collapse  ms-1" id="sidemenu" data-bs-parent="#menu"
                >
                  <li class="nav-item">
                    <a class="nav-link " href="#" aria-current="page"
                      >Create Exam</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link" href="#">Update Exam</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link " href="#">Delete Exam</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link " href="#">Assign Exam</a>
                  </li>
                </ul>
                
              </li>
              {/* --- */}
              <li className="nav-item">
                <a href="" className="nav-link active text-primary bg-light">
                  <i className="fa fa-gauge"></i>
                  <span className="ms-2">DashBoard</span>
                </a>{" "}
              </li>
            </ul>
          </div>

          {/* ------------dropdowns----------------- */}

          <div>
            <div class="dropdown open">
              <a
                class="btn btn-secondary dropdown-toggle"
                type="button"
                id="triggerId"
                data-bs-toggle="dropdown"
                aria-haspopup="true"
                aria-expanded="false"
              >
               <span>EXAMS</span>
              </a>
              <div class="dropdown-menu" aria-labelledby="triggerId">
                <a class="dropdown-item" href="#">Action</a>
                <a class="dropdown-item disabled" href="#">Disabled action</a>
              </div>
            </div>
            
          </div>
        </div>
      </div>
    </div>
  );
};

export default Mainpage2;
